import React from "react";
import reactDom from "react-dom";
import "./style.css";

function primeiroJSX() {
    return (
        <div>
            Victor Martins
        </div>
    )
}

const App = () => {
    return (
        <div className="App">
            {primeiroJSX()}
        </div>
    )
}

const rootElement = document.getElementById("root");
reactDom.render(<App />, rootElement);
